public class InnerWorkGroupWorkGroupConfigurationFactory(Action<Humidifier.Athena.WorkGroupTypes.WorkGroupConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.Athena.WorkGroupTypes.WorkGroupConfiguration>
{

    internal InnerWorkGroupEngineVersionFactory EngineVersionFactory { get; set; }

    internal InnerWorkGroupResultConfigurationFactory ResultConfigurationFactory { get; set; }

    internal InnerWorkGroupCustomerContentEncryptionConfigurationFactory CustomerContentEncryptionConfigurationFactory { get; set; }

    protected override Humidifier.Athena.WorkGroupTypes.WorkGroupConfiguration Create()
    {
        var workGroupConfigurationResult = CreateWorkGroupConfiguration();
        factoryAction?.Invoke(workGroupConfigurationResult);

        return workGroupConfigurationResult;
    }

    private Humidifier.Athena.WorkGroupTypes.WorkGroupConfiguration CreateWorkGroupConfiguration()
    {
        var workGroupConfigurationResult = new Humidifier.Athena.WorkGroupTypes.WorkGroupConfiguration();

        return workGroupConfigurationResult;
    }
    public override void CreateChildren(Humidifier.Athena.WorkGroupTypes.WorkGroupConfiguration result)
    {
        base.CreateChildren(result);

        result.EngineVersion ??= EngineVersionFactory?.Build();
        result.ResultConfiguration ??= ResultConfigurationFactory?.Build();
        result.CustomerContentEncryptionConfiguration ??= CustomerContentEncryptionConfigurationFactory?.Build();
    }

} // End Of Class

